function Movie(props) {
  let movie = props.movie;
  return (
    <>
      <div className="movie">
        <h3 className="title">Title : {movie.Title}</h3>
        <p className="year">Year : {movie.Year} </p>
        <p className="type">Type : {movie.Type} </p>
        <img src={movie.Poster} className="poster" />
      </div>
      <div>Hello</div>
    </>
  );
}
export default Movie;
